  langs:
  - typeScript
  type: property
  summary: Se cargará un archivo de registro que contiene un mensaje de registro en el intervalo de tiempo. Esto significa que la operación podría recuperar más registros que se han solicitado, ya que siempre se carga todo el archivo de registro, pero la operación no debe recuperar menos registros que se han solicitado. Si se omite, el valor predeterminado es cargar todos los registros disponibles después de la hora de inicio.
  optional: true
  syntax:
